import React from 'react';
import profilePic from '/Users/jamesgreen/Downloads/Project_Website/my-app/src/assets/profile-icon.png'; // Replace with the path to your image

const Hero = () => {
  return (
    <div className="hero">
      <div className="profile-pic">
        <img src={profilePic} alt="Profile" />
      </div>
      <div className="welcome-text">
        <blockquote>
          “It’s through mistakes that you actually can grow. You have to get bad in order to get good”
          <cite>— Paula Scher</cite>
        </blockquote>
        <h1>Hi, I am Aisha Amer</h1>
        <p>I am a UX designer with proficient skills in analytics and user-centered design who is inquisitive, empathetic, and an aesthetically versatile visual communicator.</p>
      </div>
    </div>
  );
};

export default Hero;
